import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
    Table, TableBody, TableCell, TableContainer, TableHead, TableRow,
    Paper, Button, TextField, IconButton, Select, MenuItem
} from '@mui/material';
import {
    Add as AddIcon, Edit as EditIcon, FileCopy as FileCopyIcon,
    Search as SearchIcon
} from '@mui/icons-material';
import { makeStyles, ThemeProvider, createTheme } from '@mui/material/styles';

const useStyles = makeStyles((theme) => ({
    table: {
        minWidth: 650,
    },
    form: {
        display: 'flex',
        flexDirection: 'column',
        gap: theme.spacing(2),
    },
}));

const theme = createTheme();

const Pacientes = () => {
    const classes = useStyles();
    const [pacientes, setPacientes] = useState([]);
    const [searchText, setSearchText] = useState('');
    const [rowsPerPage, setRowsPerPage] = useState(10);

    const fetchData = async () => {
        try {
            const result = await axios.get('/api/persona/listar', {
                headers: {
                    'Authorization': `Bearer ${localStorage.getItem('token')}`
                },
                params: {
                    texto: searchText
                }
            });
            setPacientes(result.data.data);
        } catch (error) {
            console.error('Error fetching data:', error.response.data);
        }
    };

    useEffect(() => {
        fetchData();
    }, [searchText]);

    const handleSearchChange = (event) => {
        setSearchText(event.target.value);
    };

    const handleAddClick = () => {
        // Función para mostrar el formulario de agregar paciente
    };

    const handleEditClick = (id) => {
        // Función para mostrar el formulario de editar paciente con los datos del paciente seleccionado
    };

    const handleHistoryClick = (id) => {
        // Función para mostrar el historial del paciente seleccionado
    };

    return (
        <ThemeProvider theme={theme}>
            <Paper>
                <h1>Pacientes</h1>
                <div>
                    <Button
                        variant="contained"
                        color="primary"
                        startIcon={<AddIcon />}
                        onClick={handleAddClick}
                    >
                        Agregar
                    </Button>
                    <TextField
                        variant="outlined"
                        placeholder="Apellido Paterno o Materno o DNI"
                        value={searchText}
                        onChange={handleSearchChange}
                        InputProps={{
                            endAdornment: (
                                <IconButton>
                                    <SearchIcon />
                                </IconButton>
                            ),
                        }}
                    />
                </div>
                <TableContainer component={Paper}>
                    <Table className={classes.table}>
                        <TableHead>
                            <TableRow>
                                <TableCell>Opciones</TableCell>
                                <TableCell>Apellido Paterno</TableCell>
                                <TableCell>Apellido Materno</TableCell>
                                <TableCell>Nombre</TableCell>
                                <TableCell>Fecha de Nacimiento</TableCell>
                                <TableCell>Sexo</TableCell>
                                <TableCell>Estado Civil</TableCell>
                                <TableCell>Numero de Documento</TableCell>
                                <TableCell>Direccion</TableCell>
                                <TableCell>Teléfono</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {pacientes.slice(0, rowsPerPage).map((paciente) => (
                                <TableRow key={paciente.idpersona}>
                                    <TableCell>
                                        <IconButton onClick={() => handleEditClick(paciente.idpersona)}>
                                            <EditIcon />
                                        </IconButton>
                                        <IconButton onClick={() => handleHistoryClick(paciente.idpersona)}>
                                            <FileCopyIcon />
                                        </IconButton>
                                    </TableCell>
                                    <TableCell>{paciente.apaterno}</TableCell>
                                    <TableCell>{paciente.amaterno}</TableCell>
                                    <TableCell>{paciente.nombre}</TableCell>
                                    <TableCell>{paciente.fecha_nacimiento}</TableCell>
                                    <TableCell>{paciente.sexo}</TableCell>
                                    <TableCell>{paciente.estado_civil}</TableCell>
                                    <TableCell>{paciente.num_documento}</TableCell>
                                    <TableCell>{paciente.direccion}</TableCell>
                                    <TableCell>{paciente.telefono}</TableCell>
                                </TableRow>
                            ))}
                        </TableBody>
                    </Table>
                </TableContainer>
                <div>
                    <Select
                        value={rowsPerPage}
                        onChange={(e) => setRowsPerPage(e.target.value)}
                    >
                        <MenuItem value={10}>10</MenuItem>
                        <MenuItem value={25}>25</MenuItem>
                        <MenuItem value={50}>50</MenuItem>
                        <MenuItem value={100}>100</MenuItem>
                    </Select>
                </div>
            </Paper>
        </ThemeProvider>
    );
};

export default Pacientes;
